import React, { Component } from 'react'
import './Navbar.css'
import ToggleButton from '../Sidebar/ToggleButton';
import profileImage from './user1.png';

export class Navbar extends Component {


  constructor(props) {
    super(props)

    this.state = {
        sideBarOpen: false,
        wrapperDiv: 'wrapper',
        pageContentDive: 'page-content-wrapper',
        sideBarDiv: 'sidebar-wrapper',
        index: 0,
        isOpen: ''
    }
}

toggleButtonClickHandler = () => {

    let new_isOpen = '';
    if (this.state.isOpen == '') {
        new_isOpen = 'open';
    }

    this.setState({
        isOpen: new_isOpen
    })

    this.setState((prevState) => {
        console.log("Event occured and method ran.");
        return { sideBarOpen: !prevState.sideBarOpen };
    })
}


  render() {

    let sideBar = null;
    let wrapperDiv = 'wrapper';
    let pageContentDiv = 'page-content-wrapper';
    let sideBarWrapper = 'sidebar-wrapper';

    if (this.state.sideBarOpen) {
        sideBar = <Sidebar />;
        wrapperDiv = 'wrapper-active';
        pageContentDiv = 'page-content-wrapper-active';
        sideBarWrapper = 'sidebar-wrapper-active';
    }

    return (
      <>
        <nav className="navbar navbar-expand navbar-light my-navbar" /* fixed-top */ >
          <ToggleButton click={this.props.sideBarClickHandler} isOpen={this.props.isOpen} />
          <h1 className="h3 mb-0 text-gray-800 brand">Cognitive Control Tower</h1>

          <ul className="navbar-nav ml-auto">

            <li className="nav-item">
              <a className="nav-link" href="#" role="button">
                <i className="fas fa-sync-alt" style={{ size: '2px' }}></i>
                <span className="badge badge-info badge-counter" style={{ fontSize: '12px' }}>!</span>
              </a>
            </li>

            <li className="nav-item">
              <a className="nav-link " href="#" role="button">
                <i className="fas fa-envelope"></i>
                <span className="badge badge-danger badge-counter">4</span>
              </a>
            </li>

            <li className="nav-item dropdown">
              <a className="nav-link dropdown-toggle" href="#" className="userDropdown" role="button"
                data-toggle="dropdown">
                <span className="mr-2 d-none d-lg-inline text-gray-600 medium">Hi Rohit</span>
                <img className="imgProfile" src={profileImage} />
              </a>
            </li>
          </ul>
        </nav>
      </>
    )
  }
}

export default Navbar;
